window.bookSummaryJSON = "<p><b>Written as a script for a video game, a manga and RPG-inspired story, this stand-alone tale follows Ashton Lighten, a 20-year-old psychology honors student, who is transported to a world of elemental manipulators. The years following the events of The Rostical Users, and The Rostical Guild series have resulted in many changes in this alternate dimension.</b></p> <p>Ashton, armed with the memories of his parents, faces off against the nefarious magical clones, Rondria, Nostias, and Abios, who seek to unleash a dangerous and powerful being upon the world. Immediately finding himself on a strange new continent, he must rely on new allies to save the world - and find his way back to all he knows.</p> <p>Vunillo has been a slave for his entire life and only now understands the injustice done to him. With Ashton by his side, he must learn to master both his unique powers and his own identity beyond societal expectations.</p> <p>Dhiya lives to serve her people, until Dhisha, her best friend, sends her away with an unusual order. She joins the quest with Ashton and Vunillo, seeking their help to try to find her reason to live.</p> <p>Grieving from the events of a dark past, Zenobia thirsts both for revenge and the cold comfort of alcohol. A chance encounter in a catacomb and an alliance of necessity, forces her into a grudging respect for our heroes. Can she learn to trust again, learn to heal from her deep wounds?</p> <p><i>The Rostical Quest</i> explores how these four unlikely friends come together to save the world and as a family. Please follow their adventure and help them see it through to the end!</p>"; 
